import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import * as serviceWorker from './serviceWorker';

var element1 = <div><h1>My first react project</h1>
<br/> Addition : {10+10}
<br/>Substraction: {10-5}
<br/>Multiplication : {10*5}
<br/>Division : {10/5}</div>
setInterval(()=>{
  var element2 = <div><p>
  Time: {new Date().toLocaleTimeString()}
</p>
  ReactDOM.render(element2,document.getElementById("root2"))
</div>
},1000)


//var element2 = <h1>Session by kiran sir</h1>

var element = React.createElement('div',null,element1)
//ReactDOM.render(element2, document.getElementById("root1"))
ReactDOM.render(element, document.getElementById("root1"))



// ReactDOM.render(
//   <React.StrictMode>
//     <App />
//   </React.StrictMode>,
//   document.getElementById('root')
// );

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
